import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('NotoSerifKannada-VariableFont_wght-normal.ttf', font);
this.addFont('NotoSerifKannada-VariableFont_wght-normal.ttf', 'NotoSerifKannada-VariableFont_wght', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
export default font;
